module.exports = a = async ({ params }) => {
  const devices = params.devices
  const user = params.user;
  const mobilePhone = user.mobilePhone

  let allowedDeviceTypes = [
    { "type": "TOTP", "count": 3, "displayLabel": "Authenticator App", "icon": "mdi-cellphone", "description": "Use an authenticator app to authenticate." },
    { "type": "PLATFORM-MAC", "count": 1, "displayLabel": "Mac Passkey", "icon": "mdi-key-chain", "description": "Authenticate using the biometrics built into your Mac device." },
    { "type": "PLATFORM-ANDROID", "count": 1, "displayLabel": "Android Passkey", "icon": "mdi-key-chain", "description": "Authenticate using the biometrics built into your Android device." },
    { "type": "PLATFORM-IOS", "count": 1, "displayLabel": "iOS Passkey", "icon": "mdi-key-chain", "description": "Authenticate using the biometrics built into your iPhone device." },
    { "type": "EMAIL", "count": 1, "displayLabel": "Email", "icon": "mdi-email-outline", "description": "Receive an email with a passcode to authenticate." },
    { "type": "SMS", "count": 1, "displayLabel": "SMS", "icon": "mdi-comment-text-outline", "description": "Receive a text message with a passcode to authenticate." },
    { "type": "VOICE", "count": 1, "displayLabel": "Voice", "icon": "mdi-phone", "description": "Use an authenticator app to authenticate." },
    { "type": "CUSTOM-MAGICLINK-EMAIL", "count": 1, "displayLabel": "Email Magic Link", "icon": "mdi-auto-fix", "description": "Receive an email with a direct link to authenticate." },
    { "type": "CUSTOM-MAGICLINK-SMS", "count": 1, "displayLabel": "SMS Magic Link", "icon": "mdi-auto-fix", "description": "Receive a text message with a direct link to authenticate." }
  ]


  // Add MagicLink, since MFA doesn't support this type
  const magicLinkDeviceEmail = {
    nickname: "Magic Link Email",
    type: "CUSTOM-MAGICLINK-EMAIL"
  }
  const magicLinkDeviceSMS = {
    nickname: "Magic Link SMS",
    type: "CUSTOM-MAGICLINK-SMS"
  }

  var newDevices = devices;

  newDevices.push(magicLinkDeviceEmail);

  // Only add magicLink for SMS if a mobilePhone is provided
  if (mobilePhone) {
    newDevices.push(magicLinkDeviceSMS);
  }

  let devicesHTML = ""
  let i = 0
  for (const device of newDevices) {
    // Build Button Text
    let newType 

    if (device.type === "PLATFORM") {
      newType = `${device.type}-${device.platform}`
    } else {
      newType = device.type
    }
    let deviceMetadata = getDevice(allowedDeviceTypes, newType)

    let buttonText = deviceMetadata.displayLabel

    if (device.nickname && (!device.type.startsWith("CUSTOM-MAGICLINK"))) {

        buttonText = `${deviceMetadata.displayLabel} (${device.nickname})`

    }
    let iconClass = deviceMetadata.icon

    devicesHTML += `
    <button data-skcomponent="skbutton" class="btn btn-outline-light flex-grow-1 overrideDeviceListButtons" data-skbuttontype="form-submit" data-skform="deviceSelectionForm" data-skbuttonvalue="${i}" id="${i}Btn">
      <div class="d-flex align-items-center gap-4" >
        <i class="mdi ${iconClass} text-dark fs-2" aria-hidden="true"></i>
        <div class="d-flex flex-column text-start gap-1">
            <div class="fw-semibold text-primary">${buttonText}</div>
            <div class="fs-5 text-secondary">${deviceMetadata.description}</div>
        </div>
      </div>
    </button>`
    i++
  }

  return {
    'devicesHTML': devicesHTML,
    'devices': newDevices
  }
}

