var checkInterval = 250   // How often to run the timer
var showButtonTime = 1000 // How long until we show the button
var waitTime = 0          // How long we have waited

var myTimer = window.setInterval(function () {

    console.log("Inside myTimer")
    waitTime += checkInterval;

    if (waitTime >= showButtonTime) {
        console.log("  clicked=true - enabling continue button display: block")

        buttonDiv = document.getElementById("button-div")

        // This should show the continue button and only run 1 time because clearInterval will stop the timer
        //
        // The expectation is that this will never run, because the page will be gone after the click
        if (buttonDiv) {
            buttonDiv.style = "display: block"
            console.log("  Clearing Timer")
        }
        clearInterval(myTimer)
    }

    var nextButton = document.getElementById("next-button")
    if (nextButton) {
        console.log("Clicking Button")
        nextButton.click()
    }
}, checkInterval)

